Step 3: 
\begin{align*}
\frac{z - 4}{z - 8} &= 1, \\
z - 4 &= z - 8, \\
4 &= 8, \\
\text{No solution}
\end{align*}

\begin{align*}
\frac{z - 4}{z - 8} &= -1, \\
z - 4 &= -z + 8, \\
2z &= 12, \\
z &= 6
\end{align*}

\begin{align*}
\left| \frac{z - 12}{z - 8i} \right| &= \frac{5}{3}, \\
\left| \frac{z - 12}{z - 8i} \right|^2 &= \frac{25}{9}, \\
\left( \frac{z - 12}{z - 8i} \right) \left( \frac{\overline{z - 12}}{\overline{z - 8i}} \right) &= \frac{25}{9}, \\
\frac{(z - 12)(\overline{z - 12})

\begin{align*}
z &= 12 \text{ is an extraneous solution, so we discard it}, \\
z &= 6
\end{align*}

Step 5: 
\begin{align*}
z = 6 \text{ is the only solution to both equations}, 
\end{align*}

